import React, { Component } from "react";

export default class answerButtons extends Component {
  render() {
    console.log(this.props);
    return (
      <div className="topMenu">
      <div className="right">
      <span role="img" aria-label="right">✅</span>
      <h3>{this.props.negativeCounter}</h3>
      </div>
      <div className="wrong">
      <span role="img" aria-label="wrong">❌</span>
      <h3>{this.props.positiveCounter}</h3>
      </div>
      </div>
    );
  }
}
